Take a seat with pilot Vlado Lenoch (we miss him :( ) in the P-51 Mustang "Baby Duck" as he leads the @f35demoteam and @f22demoteam in close formation during the USAF Heritage Flight performance at the 2016 Cleveland National Airshow. After the formation break, watch for two LOW high speed passes by Vlado before landing!

